import React, { Component } from "react";
import Link from "next/link";

export default class jobscategory extends Component {
  homeHandler = () => {
    console.log("clicked");
  };
  render() {
    return (
      <div>
        <Link href="/">
          <a>Back to home</a>
        </Link>
        {/* <button onClick={this.homeHandler}>Go to Home</button> */}
      </div>
    );
  }
}
